rew as they encounter a variety of wildlife in the most amazing environments on the planet! \\n\\nThe Brave Wilderness Channel is your one stop connection to a wild world of adventure and amazing up close animal encounters! \\n\\nFollow along with adventurer and animal expert Coyote Peterson and his crew as they lead you on three exciting expedition series - Emmy Award Winning Breaking Trail, Dragon Tails and Coyote’s Backyard - featuring everything from Grizzly Bears and Crocodiles to Rattlesnakes and Tarantulas…each episode offers an opportunity to learn something new.\\n      \\nSo SUBSCRIBE NOW and join the adventure that brings you closer to the most beloved, bizarre and misunderstood creatures known to man! \\n\\nGET READY...things are about to get WILD!   \\n               New Episodes Every Wednesday and Friday at 9AM EST\\n\\nSubscribe Now! www.youtube.com\/BraveWilderness\\n\\nFind more info at: http:\/\/www.CoyotePeterson.com\\n\\nCoyote Peterson on Twitter: twitter.com\/CoyotePeterson\\n\\nCoyote Peterson on Facebook: www.facebook.com\/CoyotePeterson\\n\\nCoyote Peterson on Instagram: www.instagram.com\/CoyotePeterson\\n\\nCoyote Peterson G+: plus.google.com\/100310803754690323805\/about\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/4DPSC0P99iw\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDy-qUP2BTxcOyJBLSl_OT2byz_tQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/4DPSC0P99iw\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBmjshPSqsjVZNdYpk3bQ_9TR9mYg\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/4DPSC0P99iw\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAcIrxuwN1m9MotEGr6ggO5rzftAQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/4DPSC0P99iw\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDe ing expedition series - Emmy Award Winning Breaking Trail, Dragon Tails and Coyote’s Backyard - featuring everything from Grizzly Bears and Crocodiles to Rattlesnakes and Tarantulas…each episode offers an opportunity to learn something new.\n      \nSo SUBSCRIBE NOW and join the adventure that brings you closer to the most beloved, bizarre and misunderstood creatures known to man! \n\nGET READY...things are about to get WILD!   \n               New Episodes Every Wednesday and Friday at 9AM EST\n\nSubscribe Now! www.youtube.com/BraveWilderness\n\nFind more info at: "},{"text":"http://www.CoyotePeterson.com","navigationEndpoint":{"clickTrackingParams":"CJwBEM2rARgBIhMIprqdxOGJ6gIVUJN7Ch18-gdoSKzs95-0wfSZ4AE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=0z_VCiwQ6_-cvlN8ykOA4z9eCll8MTU5MjUxNDY1NkAxNTkyNDI4MjU2\u0026q=http%3A%2F%2Fwww.CoyotePeterson.com\u0026v=4DPSC0P99iw\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=0z_VCiwQ6_-cvlN8ykOA4z9eCll8MTU5MjUxNDY1NkAxNTkyNDI4MjU2\u0026q=http%3A%2F%2Fwww.CoyotePeterson.com\u0026v=4DPSC0P99iw\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nCoyote Peterson on Twitter: twitter.com/CoyotePeterson\n\nCoyote Peterson on Facebook: www.facebook.com/CoyotePeterson\n\nCoyote Peterson on Instagram: www.instagram.com/CoyotePeterson\n\nCoyote Peterson G+: plus.google.com/100310803754690323805/about"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJ0BEJsrIhMIprqdxOGJ6gIVUJN7Ch18-gdo","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","
